import './SimpleLineChart.css';
import mock from '../../data/mock.json'
import { ReferenceArea, AreaChart, Area, LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';


const CustomTooltip = ({ active, payload }) => {
    if (active && payload && payload.length) {
        return (
            <div className="lineChart-tooltip">
                <p className="tooltip-label">{`${payload[0].value} min`}</p>
            </div>
        );
    }
    return null;
};

const renderLegend = () => {
    return <text fill='#f0bab4'>Durée moyenne des sessions</text>
}

const CustomTick = ({ index, x, y }) => {
    switch (index) {
        case 0:
            return (
                <text x={x - 5} y={y + 10} fill='#f0bab4'>
                    L
                </text>
            );
        case 1:
            return (
                <text x={x - 5} y={y + 10} fill='#f0bab4'>
                    M
                </text>
            );
        case 2:
            return (
                <text x={x - 5} y={y + 10} fill='#f0bab4'>
                    M
                </text>
            );
        case 3:
            return (
                <text x={x - 5} y={y + 10} fill='#f0bab4'>
                    J
                </text>
            );
        case 4:
            return (
                <text x={x - 5} y={y + 10} fill='#f0bab4'>
                    V
                </text>
            );
        case 5:
            return (
                <text x={x - 5} y={y + 10} fill='#f0bab4'>
                    S
                </text>
            );
        case 6:
            return (
                <text x={x - 5} y={y + 10} fill='#f0bab4'>
                    D
                </text>
            );
        default:
            break;
    }
};

function LineCustomTooltip(active) {
    if (!active.payload) {
        return null;
    }
}

