                </LineChart> */}
                <LineChart width={500} height={500} data={mock.data.averageSessions}>
                    <defs>
                        <linearGradient id="colorGradiant" x1="0%" y1="0%" x2="100%" y2="0%">
                            <stop offset="0%" stopColor="#ffffff80" />
                            <stop offset="50%" stopColor="#ffffffbf" />
                            <stop offset="100%" stopColor="#ffffff" />
                        </linearGradient>
                    </defs>
                    <Legend content={renderLegend} align='right' verticalAlign="top" height={36} />
                    <Line
                        type="monotone"
                        dataKey="sessionLength"
                        stroke="url(#colorGradiant)"
                        strokeWidth={5}
                        dot={false}
                    />
                    <XAxis dataKey="day" tick={<CustomTick />} tickLine={false} axisLine={false} label={{ stroke: '#EAF0F4' }} />
                    <Tooltip content={<CustomTooltip />} position={{ y: 0 }} fill='#f0bab4' contentStyle={{ backgroundColor: "blue" }} itemStyle={{ color: "green" }} />
                    <ReferenceArea x1={150} x2={180} y1={200} y2={300} stroke="red" strokeOpacity={0.3} />
                </LineChart>
            </ResponsiveContainer>
        </div>

    );
}

export default SimpleLineChart;
